export const Products = (props) => { 

    const infos = props.items;

    return(
        <div>
            {infos && infos.map((item) => (
                <div key={item.carClassId}>
                    <img src= {item.image} alt={`${item.carClassNfame} 차량`}/>
                    <li>{item.carClassName}</li>
                    <li>{item.carModel}</li>
                    <li>{item.carTypeTags}</li>
                    <li>{item.discountPercent}</li>
                    <li>{item.drivingDistance}</li>
                    <li>{item.price}</li>
                    <li>{item.regionGroups}</li>
                    <li>{item.year}</li>
                </div>    
            ))}

        </div>
    );
}

export default Products;
